import HelloTab from "./Tabs/HelloTab/hello-tab";
import Section from "./components/sections/section";

function App() {
  return (
    <>
      <div className="section_wrapper">
        <Section children={<HelloTab />} />
      </div>
    </>
  );
}

export default App;
